import React from 'react';

const contactEmails = (props) => {
    return (
        <div className="mt-3">
            <h2 className="text-info">Your question has been submitted</h2>
            <hr />
            <p>Thanks for sending us your question. A member of our Customer
                 Care team will get back to you soon.</p>
        </div>
    )
}

export default contactEmails;
